import "./App.scss";
// My components
import Header from "./shared/Header/Header";
import Posts from "./pages/posts/Posts";

// Module import
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Header />

      <Router>
        <Switch>
          <Route path="/">
            <h1>Hola home</h1>
          </Route>
          <Route path="/posts">
            <h1>Hola home</h1>
          </Route>
          <Route path={`/posts/:id`}>
            <h1>Hola home id</h1>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
